/**
 * Normalizuje tekst usuwając polskie znaki diakrytyczne
 */
function normalizeText(text: string): string {
  if (!text) return '';
  
  return text
    .toLowerCase()
    .normalize('NFD')
    .replace(/[\u0300-\u036f]/g, '')
    .replace(/ł/g, 'l')
    .replace(/Ł/g, 'l');
}

export function searchAirports(query: string, limit = 10): Airport[] {
  const q = normalizeText(query.trim());
  if (q.length < 2) return [];

  return airports
    .filter(a =>
      normalizeText(a.code).includes(q) ||
      normalizeText(a.city_en).includes(q) ||
      normalizeText(a.city_pl).includes(q) ||
      normalizeText(a.name).includes(q) ||
      normalizeText(a.country_en).includes(q)
    )
    .sort((a, b) => {
      if (normalizeText(a.code) === q) return -1;
      if (normalizeText(b.code) === q) return 1;
      
      const aStartsPl = normalizeText(a.city_pl).startsWith(q);
      const bStartsPl = normalizeText(b.city_pl).startsWith(q);
      if (aStartsPl && !bStartsPl) return -1;
      if (!aStartsPl && bStartsPl) return 1;
      
      const aStartsEn = normalizeText(a.city_en).startsWith(q);
      const bStartsEn = normalizeText(b.city_en).startsWith(q);
      if (aStartsEn && !bStartsEn) return -1;
      if (!aStartsEn && bStartsEn) return 1;
      
      return a.city_pl.localeCompare(b.city_pl);
    })
    .slice(0, limit);
}

export function getAirportByCode(code: string): Airport | undefined {
  return airports.find(a => a.code.toUpperCase() === code.toUpperCase());
}

// Pomocnicza funkcja do wyświetlania nazwy miasta (preferuje polską)
export function getDisplayCity(airport: Airport): string {
  return airport.city_pl || airport.city_en;
}
